import React, { useEffect, useState} from 'react';
import { Col, Container } from 'react-bootstrap';
import { useParams } from 'react-router-dom';

function Evento(){
    let data = useParams();
    let id = data.id;
    return(
        <Container>
            <div className='tarjetaEvento'>
                <div style={{float: left}}>
                    Hola
                </div>
            </div>
        </Container>
    )
}
export default Evento;
